<script setup>

defineProps({
  selectedProvinceAbbreviation: String,
})

const getProvinceColor = (provinceId) => {
  // Example color assignments; extend or modify as needed
  const colors = {
    'CA-AB': '#ff9999', // Alberta
    'CA-BC': '#99ccff', // British Columbia
    'CA-SK': '#fde910', // Saskatchewan
    'CA-MB': '#ffb6c1', // Manitoba
    'CA-ON': '#ffa500', // Ontario
    'CA-QC': '#add8e6', // Quebec
    'CA-NB': '#90ee90', // New Brunswick
    'CA-NS': '#9370db', // Nova Scotia
    'CA-PE': '#ffc0cb', // Prince Edward Island
    'CA-NL': '#ddadaf', // Newfoundland and Labrador
    'CA-YT': '#d3d3d3', // Yukon
    'CA-NT': '#87ceeb', // Northwest Territories
    'CA-NU': '#ffa07a', // Nunavut
  };

  return colors[provinceId] || '#ddd'; // Default color if ID not found
};

// Example of setting hover colors dynamically
const hoverColors = {
  'CA-AB': '#e68a8a', // Alberta
  'CA-BC': '#88bbee', // British Columbia
  'CA-SK': '#e6e600', // Saskatchewan
  'CA-MB': '#ffafbf', // Manitoba
  'CA-ON': '#e59400', // Ontario
  'CA-QC': '#9ec2e6', // Quebec
  'CA-NB': '#80e080', // New Brunswick
  'CA-NS': '#8467d7', // Nova Scotia
  'CA-PE': '#ffbfd0', // Prince Edward Island
  'CA-NL': '#cd9b9b', // Newfoundland and Labrador
  'CA-YT': '#c0c0c0', // Yukon
  'CA-NT': '#78d5f5', // Northwest Territories
  'CA-NU': '#ff9070', // Nunavut
};

// Method to handle mouse over - could set a data property to change styles
const mouseOverProvince = (event) => {
  const provinceId = event.target.id;
  event.target.style.fill = hoverColors[provinceId] || '#0000ff'; // Default to blue
  event.target.style.cursor = 'pointer'; // Directly set the cursor style
};

// Reset color on mouse leave, if you want to revert to original or handle dynamically
const mouseLeaveProvince = (event) => {
  event.target.style.fill = getProvinceColor(event.target.id); // Reset to CSS default
};
</script>
<style scoped>
.province:hover {
  cursor: pointer;
  fill: var(--hover-color, blue); /* Default to blue if no color is set */
}
.province {
  cursor: pointer;
}
</style>